const snoop = () => {};

const initialStore = {
    ropesOrder: {
        shopAddress: '',
        brandData: {},
        order: []
    },
    user: {
        email: '',
        name: '',
        surname: '',
        shop_id: '',
        token: '',
        isAuth: false,
        login: snoop,
        isActivated: false
    }
}

export default initialStore;
